def minPath(grid, k):
    from collections import deque

    N = len(grid)
    directions = [(0, 1), (1, 0), (0, -1), (-1, 0)]

    def in_bounds(x, y):
        return 0 <= x < N and 0 <= y < N

    def bfs(start_x, start_y):
        queue = deque([(start_x, start_y, [grid[start_x][start_y]])])
        min_path = None

        while queue:
            x, y, path = queue.popleft()

            if len(path) == k:
                if min_path is None or path < min_path:
                    min_path = path
                continue

            for dx, dy in directions:
                nx, ny = x + dx, y + dy
                if in_bounds(nx, ny):
                    queue.append((nx, ny, path + [grid[nx][ny]]))

        return min_path

    overall_min_path = None

    for i in range(N):
        for j in range(N):
            current_min_path = bfs(i, j)
            if overall_min_path is None or current_min_path < overall_min_path:
                overall_min_path = current_min_path

